import { Box, Container, Button } from '@chakra-ui/core'
import styled from '@emotion/styled'
import { FaSignInAlt} from 'react-icons/fa'
import { BsFillPersonFill} from 'react-icons/bs'

const SignInAndJoin = styled.div`
  height:52px;
  line-height:52px;
  border-left: 1px solid #393939;
  border-right: 1px solid #393939;
  padding: 0 6px;
  float: left;
  color:#FFF;
  & > button {
    padding: 0 10px;
  }
`

export default function Header() {
  return <Box h={52} bgColor="#202020" borderBottom="1px solid #393939">
    <Container h={52} maxW={1200}>
      <SignInAndJoin>
        <Button leftIcon={<FaSignInAlt />}>登录</Button>
        <Button leftIcon={<BsFillPersonFill />}>注册</Button>
      </SignInAndJoin>
    </Container>
  </Box>
}
